class MinTree {
    // 生成一个邻接矩阵

    /**
     * @param graph      一个图对象
     * @param vertexSize 图中顶点个数
     * @param vertex     图中顶点的值
     * @param edges      图的权值（邻接矩阵）
     */

    public void createGraph(Graph graph, int vertexSize, int[] vertex, int[][] edges) {
//        相当于手动创建
        for (int i = 0; i < vertexSize; i++) {
            graph.vertex[i] = vertex[i];
            for (int j = 0; j < vertexSize; j++) {
                graph.edges[i][j] = edges[i][j];
            }
        }

    }

    public void showGraph(Graph graph) {
        for (int[] edge : graph.edges) {
            System.out.println(Arrays.toString(edge));
        }
    }

    /**
     * @param graph 一个图
     * @param v     当前我们开始顶点下标
     */
    public void prim(Graph graph, int v) {
        // 用来标记当前顶点是否访问
        int visited[] = new int[graph.vertexSize];
        // 当前顶点要被记录成访问
        visited[v] = 1;
        // 用于存放未被遍历的顶点中与已被遍历的顶点的最小值的顶点
        int minV = -1;
        int minI = -1;
        // 寻找最小权值并记录，默认为无穷大
        int minDistance = Integer.MAX_VALUE;
        // 循环遍历k个顶点，正好和之前的n-1次对应
        for (int k = 1; k < graph.vertexSize; k++) {
            // 我们要确定每一次生成子图中最短的一条路径并记录
            for (int i = 0; i < graph.vertexSize; i++) {
                for (int j = 0; j < graph.vertexSize; j++) {
                    if (visited[i] == 1 && visited[j] == 0 && graph.edges[i][j] != 0 && graph.edges[i][j] < minDistance) {
                        // 找到当前子图中最小路径并记录
                        minDistance = graph.edges[i][j];
                        // 记录最小路径的下标
                        minV = i;
                        minI = j;

                    }
                }

            }

            System.out.println(graph.vertex[minV] + "," + graph.vertex[minI] + " " + minDistance);
            visited[minI] = 1;
            minDistance = Integer.MAX_VALUE;
        }
    }
}

class Graph {
    int vertexSize;// 顶点存放个数
    int[] vertex;// 存放顶点的数据
    int[][] edges;// 存放一个权值

    public Graph(int vertexSize) {
        this.vertexSize = vertexSize;
        this.vertex = new int[vertexSize];
        this.edges = new int[vertexSize][vertexSize];
    }

}
